import React from 'react';

function Accueil() {
    
    return (
        <div id="wrapper">
            <div className="d-sm-flex align-items-center justify-content-between mb-4">
                <h1 className="h3 mb-0 text-gray-800">Bienvenue !</h1>
            </div> 
        </div>
    );

}

export default Accueil;
